import React from 'react';
import {Container, Button, Row} from 'react-bootstrap';

const Floor = ({floor}) => <Row className="col-6"><Button className="col-6" block>Planta {floor}</Button>
</Row>

const Floors = ({floors}) => <Container className="p-3 d-flex">{
    floors.map((floor,i) => <Floor floor={floor} key={i}/>)
}</Container>

export default Floors;
